import React from 'react'
import Title from './Title'
import { useNavigate } from 'react-router-dom';

export default function Home() {

    const navigate = useNavigate()







  return (
    <div>
        <Title text = {"WILLING"}/>
        <button className='largeBtn' onClick={()=>navigate('/find')}>find willing</button>
        <button className='largeBtn' onClick={()=>navigate('/add')}>add willing</button>
    </div>
  )
}
